sys_variable_value.value:
(function execute(inputs, outputs) {

  var url = gs.getProperty('x_rhtpp_eda.webhook_url');
  var token = gs.getProperty('x_rhtpp_eda.webhook_token');
  var mid_server = gs.getProperty('x_rhtpp_eda.mid_server');
  var body = inputs.body;
  var table = inputs.table;
  var record_id = inputs.record_id;

  var http = new EdaEventDirect();
  http.send(url, token, mid_server, body, table, record_id);
})(inputs, outputs);

